import React from "react";

export default function DogInfo({ pup }) {

  const goodDog = (pup) => {
    return pup.isGoodDog ? 'Good Dog!' : 'Bad Dog!'
  }

  const displayPup = (pup) => {
    if (pup !== {}) {
     return ( <div id="dog-info">
      <img src={pup.image} alt={pup.name + "puppy"} />
      <h2>{pup.name}</h2>
  <button>{goodDog(pup)}</button>
    </div>
     ) 
    } else {
      return null
    }
  }

  return (
    <div id>
    {displayPup(pup)}
    </div>
  );
}
